(63, 1, 'php', '%message in %file on line %line.', 'a:4:{s:6:"%error";s:12:"user warning";s:8:"%message";s:1929:"Duplicate entry &#039;admin/content/node-type/page&#039; for key 1\nquery: INSERT INTO menu_router\n      (path, load_functions, to_arg_functions, access_callback,\n      access_arguments, page_callback, page_arguments, fit,\n      number_parts, tab_parent, tab_root,\n      title, title_callback, title_arguments,\n      type, block_callback, description, position, weight, file)\n      VALUES (&#039;admin/content/node-type/page&#039;, &#039;&#039;, &#039;&#039;, &#039;user_access&#039;,\n      &#039;a:1:{i:0;s:24:\\&quot;administer content types\\&quot;;}&#039;, &#039;drupal_get_form&#039;, &#039;a:2:{i:0;s:14:\\&quot;node_type_form\\&quot;;i:1;O:8:\\&quot;stdClass\\&quot;:14:{s:4:\\&quot;type\\&quot;;s:4:\\&quot;page\\&quot;;s:4:\\&quot;name\\&quot;;s:4:\\&quot;Page\\&quot;;s:6:\\&quot;module\\&quot;;s:4:\\&quot;node\\&quot;;s:11:\\&quot;description\\&quot;;s:296:\\&quot;A &lt;em&gt;page&lt;/em&gt;, similar in form to a &lt;em&gt;story&lt;/em&gt;, is a simple method for creating and displaying information that rarely changes, such as an \\&quot;About us\\&quot; section of a website. By default, a &lt;em&gt;page&lt;/em&gt; entry does not allow visitor comments and is not featured on the site\\&#039;s initial home page.\\&quot;;s:4:\\&quot;help\\&quot;;s:0:\\&quot;\\&quot;;s:9:\\&quot;has_title\\&quot;;s:1:\\&quot;1\\&quot;;s:11:\\&quot;title_label\\&quot;;s:5:\\&quot;Title\\&quot;;s:8:\\&quot;has_body\\&quot;;s:1:\\&quot;1\\&quot;;s:10:\\&quot;body_label\\&quot;;s:4:\\&quot;Body\\&quot;;s:14:\\&quot;min_word_count\\&quot;;s:1:\\&quot;0\\&quot;;s:6:\\&quot;custom\\&quot;;s:1:\\&quot;1\\&quot;;s:8:\\&quot;modified\\&quot;;s:1:\\&quot;1\\&quot;;s:6:\\&quot;locked\\&quot;;s:1:\\&quot;0\\&quot;;s:9:\\&quot;orig_type\\&quot;;s:4:\\&quot;page\\&quot;;}}&#039;, 15,\n      4, &#039;&#039;, &#039;admin/content/node-type/page&#039;,\n      &#039;Page&#039;, &#039;t&#